CREATE TABLE IF NOT EXISTS people (
    `id` INT,
    `name` VARCHAR(44) CHARACTER SET utf8,
    `email` INT,
    `gender` INT,
    `dob` INT,
    `place_Of_b` VARCHAR(44) CHARACTER SET utf8,
    `national_number` VARCHAR(18) CHARACTER SET utf8,
    `marital_status` INT,
    `military_service` INT,
    `Current_address` VARCHAR(70) CHARACTER SET utf8,
    `fixed_phone` INT,
    `mobile_number` VARCHAR(30) CHARACTER SET utf8,
    `img` INT,
    `lang` INT,
    `user_id` INT,
    `created_at` INT,
    `updated_at` INT
);
